import { useParams } from 'react-router-dom';
import { useSelector } from 'react-redux';
import { selectData } from './homeSlice';
import Cards from "./cards";
import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { fetchDataAsync } from "./homeSlice";
function BBCNews() {
    const dispatch = useDispatch();
    let params = useParams();
    const articles = useSelector((store) => store.home); console.log(articles)
    const article = articles.articles.find(elem => elem.title === params.id);
    useEffect(() => {
        dispatch(fetchDataAsync())
    }, [])
    return (
        <div>
            <Cards data={article} />
        </div>
    )
}

export default BBCNews;
